import { Typography } from "@material-ui/core";
import React from "react";
import { Container, Row, Col } from "react-bootstrap";


export function SecondScreen(){
    return(
        <Container fluid>
            <Row>
                <Col sm md={8}>
                    <Typography className="text-center" variant='h2'>¿Cómo lo hacemos realidad?</Typography>
                    <Typography>Nuestro modelo de riesgos evalúa en segundos una operación, lo que nos permite financiar en el mismo día.</Typography>
                </Col>
            </Row>
        </Container>
    )
}
